import React, { useState } from "react";
import HomeIcon from "@mui/icons-material/Home";
import NotificationsIcon from "@mui/icons-material/CircleNotifications";
import AddCommentSharpIcon from "@mui/icons-material/AddCommentSharp";
import ContactSupportSharpIcon from "@mui/icons-material/ContactSupportSharp";
import SettingsSuggestSharpIcon from "@mui/icons-material/SettingsSuggestSharp";
import ListItemButton from "@mui/material/ListItemButton";
import List from "@mui/material/List";
import ListItemIcon from "@mui/material/ListItemIcon";
import ListItemText from "@mui/material/ListItemText";
import ArrowDropDownSharpIcon from "@mui/icons-material/ArrowDropDownSharp";
import ListItem from "../ListItem";

const [open, setOpen] = useState(true);
const handleClick = () => {
  setOpen(!open);
};

const ButtonData = [
  { name: "Home", icon: <HomeIcon /> },
  { name: "Notifications", icon: <NotificationsIcon /> },
  { name: "Add", icon: <AddCommentSharpIcon /> },
  { name: "About", icon: <ContactSupportSharpIcon /> },
  { name: "Setting", icon: <SettingsSuggestSharpIcon /> },
  {
    name: "Subreddits",
    icon: <ArrowDropDownSharpIcon />,
    subItem: [{ name: "Add", icon: <AddCommentSharpIcon /> }],
  },
];

const SideBarButton = () => {
  return (
    <div>
      <List sx={{ width: "100%", maxWidth: 360 }}>
        {ButtonData.map((item, index) => (
          <ListItem item={item} />
        ))}
      </List>
    </div>
  );
};

export default SideBarButton;
